import React from 'react'
import './Scrollup.css'

const Scrollup = () => {
  return (
 
      <a href="" className="scrollup">
        <i className="bx bxs-up-arrow-circle scrollup__icon">
        <i class='bx bxs-up-arrow-circle'></i>
        </i>
    </a>

   
 
    
  )
}

export default Scrollup
